import ThreeLogo from 'components/ThreeLogo'
import "../../assets/styles/rondoudou.scss"

const Home = () => {

    useEffect(() => {
        console.log('Hello bg')
        document.getElementById('high-nav').remove()
    });

    return (
        <div className='homepage'>
            <h1></h1>
            <div className='my-canvas'>
                <ThreeLogo />
            </div>
        </div>
    )
}

export default Home
